import React, { Component } from 'react';
import Movie1 from './movie1';

class Movies1 extends Component {
    render() {
        return (
            <React.Fragment>
                <table class="table">
                    <thead>
                        <tr>
                            <th>ID</th>
                            <th>NAME</th>
                            <th>GENRE</th>
                            <th>LENGTH</th>
                        </tr>
                    </thead>
                    <tbody>
                        {this.state.movies.map( m => {
                            return <Movie1 key={m.id} id={m.id} name={m.name} genre={m.genre} length={m.length}/>
                        } )}
                    </tbody>    
                </table>
            </React.Fragment>
        );
    }
}

export default Movies1;
